<!DOCTYPE html>
<html xmlns:wicket="http://wicket.apache.org">
<head>
    <meta charset="utf-8"/>
    <title>EditCNSCMenuPage</title>
</head>
<body>
<wicket:extend>
    <div class="row">
        <div class="col-md-12">
            <div wicket:id="logo"></div>
        </div>
    </div>
    <div class="row">
        <div wicket:id="searchUrl" class="col-md-6"></div>
        <div wicket:id="isSearchUrlEnabled" class="col-md-6"></div>
    </div>
    <div class="row">
        <div wicket:id="menuTree" class="col-md-12"></div>
    </div>
</wicket:extend>
</body>
</html>
